def toDouble (s : String) = {
    if("(null)".equals(s)) -1d else s.toDouble
}

def toInt (s : String) =  {
    if("(null)".equals(s)) -1 else s.toInt
}

def toLong(s : String) =  {
    if("(null)".equals(s)) -1 else s.toLong
}

def transString(s : String) =  {
    s.replaceAll("\"","")
}

